#define VS_VERSION_MAJ      0
#define VS_VERSION_MIN      2
#define VS_VERSION_REV      7
#define VS_VERSION_BLD      1

/* APR_STRINGIFY is defined here, and also in apr_general.h, so wrap it */
#ifndef APR_STRINGIFY
/** Properly quote a value as a string in the C preprocessor */
#define APR_STRINGIFY(n) APR_STRINGIFY_HELPER(n)
/** Helper macro for APR_STRINGIFY */
#define APR_STRINGIFY_HELPER(n) #n
#endif

#define VS_FILE_VERSION_BIN  VS_VERSION_MAJ ##, ##VS_VERSION_MIN ##, \
                               ##VS_VERSION_REV ##, ##VS_VERSION_BLD

#define VS_FILE_VERSION_STR  APR_STRINGIFY(VS_VERSION_MAJ)        \
                               "." APR_STRINGIFY(VS_VERSION_MIN)   \
                                 "." APR_STRINGIFY(VS_VERSION_REV)  \
                                   "." APR_STRINGIFY(VS_VERSION_BLD)

#define VERSION VS_FILE_VERSION_STR


